"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F54628&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 498px\">",
"   <div class=\"ttl\">",
"    TUG flap breast reconstruction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 478px; height: 600px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The transverse upper gracilis (TUG) flap is based on the proximal gracilis muscle and its vascular pedicle, the ascending branch of the medial circumflex femoral artery. This flap utilizes tissue from the posterior upper thigh/lower buttock and provides another choice for women with insufficient lower abdominal fat for breast reconstruction.",
"    <div class=\"footnotes\">",
"    </div>",
