var title_f0_49_791="Pulmonic regurgitation CW Doppler";
var content_f0_49_791=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F71753&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F71753&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 592px\">",
"   <div class=\"ttl\">",
"    Pulmonic regurgitation CW Doppler",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 572px; height: 431px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This echocardiographic frame demonstrates the use of the pulmonary insufficiency jet velocity, measured by continuous wave Doppler from the right ventricular outflow tract, to estimate mean pulmonary artery pressure. The continuous wave Doppler beam is aligned with the pulmonary insufficiency jet. The peak pulmonary artery velocity (v) is 1.5 m/sec, which translates into a mean pulmonary artery pressure of 16 mmHg using the regression equation of 4 (v)",
"    <sup>",
"     2",
"    </sup>",
"    = 0.7 [(mean pulmonary arterial pressure) &ndash; 2].",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
